window.onload = () => {
    document.getElementById("addEmployeeModal").addEventListener("click", AddEmployee, false);
    document.getElementById("openEmployeeModal").addEventListener("click", openModal, false);
    document.getElementById("picture-input").addEventListener("change", previewProfilePicture, false);
    document.getElementById("search-employee").addEventListener("change", searchEmployee, false);
    document.querySelectorAll(".close-myModal").forEach(e => {
        e.addEventListener("click", closeModal, false);
    });

    // document.getElementById("table-sort-by").addEventListener("change", maintainEmployeeOrder, false);
    // document.getElementById("table-sort-order").addEventListener("change", maintainEmployeeOrder, false);
    document.getElementById("filterButton").addEventListener("click", maintainEmployeeOrder, false);

    currentEmployees = JSON.parse(localStorage.getItem('employees'));

    if (currentEmployees == undefined) {
        localStorage.setItem('employees', JSON.stringify([]));
        localStorage.setItem('employeeNextId', JSON.stringify(0));
    } else {
        currentEmployees.forEach(e => {
            AppendTable(e, currentEmployees.indexOf(e));
        });
    }

    setDelete();
}

//Open modal function
function openModal() {
    document.getElementById('myModal').style = "display:block";
    document.getElementById('myModal').classList.add("show");
}

//Close modal function
function closeModal() {
    resetModalForm();
    document.getElementById('myModal').style = "display:none";
    document.getElementById('myModal').classList.remove("show");
}

//Closing modal at outside click function
window.onclick = function(event) {
    if (event.target == document.getElementById('myModal')) {
        closeModal();
    }
}

function AppendTable(employee, orderIndex) {

    var defaultPicture = employee.picture;

    if (defaultPicture === "") {
        if (employee.sex === "Masculin")
            defaultPicture = mockMaleProfilePic;
        else
            defaultPicture = mockFemaleProfilePic;
    }

    tableContent = `<tr employeeId = ${employee.employeeId}>
    <td>${orderIndex + 1}</td>
    <td><img src="${defaultPicture}" class="picture"></td>
    <td>${employee.Name}</td>
    <td>${employee.email}</td>
    <td>${employee.sex}</td>
    <td>${employee.birthDate}</td>
    <td><div class="delete-container"><a href="#" class="delete" title="Delete" data-toggle="tooltip"><i class="material-icons">&#xE5C9;</i></a></div></td>
    </tr>`
    console.log(employee);
    document.getElementById("tableEmployees").innerHTML += tableContent;
}

function formValidation(Name, email, sex, birthDate, picture) {
    formIsValid = validateEmployeeFields(Name, email, sex, birthDate);

    if (formIsValid) {
        employeeId = JSON.parse(localStorage.getItem('employeeNextId'));
        allEmployees = JSON.parse(localStorage.getItem('employees'));

        newEmployee = new Employee(employeeId++, Name, email, sex, birthDate, picture);
        allEmployees.push(newEmployee);

        localStorage.setItem('employeeNextId', JSON.stringify(employeeId));
        localStorage.setItem('employees', JSON.stringify(allEmployees));

        maintainEmployeeOrder();
        // AppendTable(newEmployee, allEmployees.length - 1);
        setDelete();
        closeModal();

    }
}

function AddEmployee() {
    Name = document.getElementById("name-input").value;
    email = document.getElementById("email-input").value;
    sex = document.getElementById("sex-input").value;
    birthDate = document.getElementById("birthdate-input").value;
    picture = document.getElementById("picture-input").files[0];

    var reader = new FileReader();
    // Populate table once the image is ready
    reader.addEventListener("load", () => {
        readProfilePic = reader.result;
        formValidation(Name, email, sex, birthDate, readProfilePic);
    });
    if (picture != undefined) {
        reader.readAsDataURL(picture);
    } else {
        formValidation(Name, email, sex, birthDate, "");
    }


}

//Delete event set on click
function setDelete() {
    document.querySelectorAll(".delete").forEach(e => {
        e.addEventListener("click", deleteEmployeeRow, false);
    });
}

//Delete employee function
function deleteEmployeeRow(htmlDeleteElement) {
    if (confirm('Are you sure to delete this employee?')) {
        rowToBeDeleted = htmlDeleteElement.target.closest("tr");
        employeeToDeleteId = rowToBeDeleted.getAttribute("employeeId");

        rowToBeDeleted.remove();

        allEmployees = JSON.parse(localStorage.getItem('employees'));
        allEmployees = allEmployees.filter(e => e.employeeId != employeeToDeleteId);

        localStorage.setItem('employees', JSON.stringify(allEmployees));
        document.getElementById("tableEmployees").innerHTML = "";
        var tableCount = 0;
        allEmployees.forEach(e => {
            AppendTable(e, tableCount++);
        });
    }
}

// Employee constructor
function Employee(employeeId, Name, email, sex, birthDate, picture) {
    this.employeeId = employeeId;
    this.Name = Name;
    this.email = email;
    this.birthDate = moment(birthDate).format('D MMMM YYYY');
    this.sex = sex;
    this.picture = picture;
}

//Validators
// https://www.codegrepper.com/code-examples/javascript/javascript+funtion+to+calculate+age+above+18
function validateAgeAtLeast16(dateStr) {
    birthdate = new Date(dateStr);
    dateDifference = new Date(Date.now() - birthdate.getTime());
    personAge = dateDifference.getUTCFullYear() - 1970;
    return personAge >= 16;
}

function noFutureBirths(dateStr) {
    birthdate = new Date(dateStr);
    dateDifference = new Date(Date.now() - birthdate.getTime());
    personAge = dateDifference.getUTCFullYear() - 1970;
    return personAge <= 0;
}

function validateEmployeeFields(employeeName, employeeEmail, employeeSex, employeeBirthdate) {
    if (employeeName == "") {
        return false;
    }

    if (employeeEmail == "") {
        return false;
    } else {
        // regex validation for email:  https://stackoverflow.com/questions/46155/how-to-validate-an-email-address-in-javascript
        const re = /^(([^<>()[\]\.,;:\s@\"]+(\.[^<>()[\]\.,;:\s@\"]+)*)|(\".+\"))@(([^<>()[\]\.,;:\s@\"]+\.)+[^<>()[\]\.,;:\s@\"]{2,})$/i;
        if (!re.test(employeeEmail)) {
            return false;
        }
    }
    if (employeeSex == "") {
        return false;
    }
    if (employeeBirthdate == "") {
        return false;
    } else if (noFutureBirths(employeeBirthdate)) {
        alert("Are you born in the fucking future, Marty McFly?");
        return false;
    } else if (!validateAgeAtLeast16(employeeBirthdate)) {
        alert("Employee must be at least 16 years old!");
        return false;
    }
    return true;
}

// Preview Profile Picture in Modal
function previewProfilePicture() {
    employeeProfilePicPreview = document.getElementById("picture-input").files[0];
    previewImg = document.getElementById("imgPreview");
    var reader = new FileReader();
    // Populate table once the image is ready
    reader.addEventListener("load", () => {
        chosenImage = reader.result;
        previewImg.style = 'display:block; border-radius:50%';
        previewImg.setAttribute('src', chosenImage);
    });
    reader.readAsDataURL(employeeProfilePicPreview)
}

// Reset modal form
function resetModalForm() {
    document.getElementById("name-input").value = '';
    document.getElementById("email-input").value = '';
    document.getElementById("sex-input").value = '';
    document.getElementById("birthdate-input").value = '';
    // reset image input
    document.getElementById("picture-input").files[0] = undefined;
    document.getElementById("picture-input").value = '';
    document.getElementById("imgPreview").style = 'display:none';
}

// Comparison functions
function compareNamesAsc(a, b) {
    if (a.Name.toUpperCase() < b.Name.toUpperCase()) {
        return -1;
    }
    if (a.Name.toUpperCase() > b.Name.toUpperCase()) {
        return 1;
    }
    return 0;
}

// the smaller the year, the older the person
function compareBirthdateAsc(a, b) {
    ageA = parseInt(moment(a.birthDate).fromNow().split(' ')[0]); // "13 years ago" --> 13 as an int 
    ageB = parseInt(moment(b.birthDate).fromNow().split(' ')[0]);

    if (ageA < ageB) {
        return -1;
    }
    if (ageA > ageB) {
        return 1;
    }
    return 0;
}

function compareNamesDesc(a, b) {
    if (a.Name.toUpperCase() < b.Name.toUpperCase()) {
        return 1;
    }
    if (a.Name.toUpperCase() > b.Name.toUpperCase()) {
        return -1;
    }
    return 0;
}

function compareBirthdateDesc(a, b) {
    ageA = parseInt(moment(a.birthDate).fromNow().split(' ')[0]); // "13 years ago" --> 13 as an int 
    ageB = parseInt(moment(b.birthDate).fromNow().split(' ')[0]);

    if (ageA < ageB) {
        return 1;
    }
    if (ageA > ageB) {
        return -1;
    }
    return 0;
}

// Sorts and reprints the whole table
function maintainEmployeeOrder() {
    allEmployees = JSON.parse(localStorage.getItem("employees"));

    fieldToSortBy = document.getElementById("table-sort-by").value;
    sortOrder = document.getElementById("table-sort-order").value;

    if (fieldToSortBy == 'name') {
        if (sortOrder == 'ascendent') {
            allEmployees.sort(compareNamesAsc);
        } else {
            allEmployees.sort(compareNamesDesc);
        }
    } else if (fieldToSortBy == 'birthdate') {
        if (sortOrder == 'ascendent') {
            allEmployees.sort(compareBirthdateDesc);
        } else {
            allEmployees.sort(compareBirthdateAsc);
        }
    }

    document.getElementById("tableEmployees").innerHTML = "";
    var tableCount = 0;
    allEmployees.forEach(e => {
        AppendTable(e, tableCount++);
    });
    setDelete();
}

//Search employee by string (search bar)
function searchEmployee() {
    var input, filter, table, tr, td, i;
    input = document.getElementById("search-employee");
    filter = input.value.toUpperCase();
    table = document.getElementById("tableEmployees");
    tr = table.getElementsByTagName("tr");

    for (i = 0; i < tr.length; i++) {
        td = tr[i].getElementsByTagName("td")[1]; // for column name

        if (td) {
            if ((td.innerHTML.toUpperCase().indexOf(filter) > -1)) {
                tr[i].style.display = "block";
            } else {
                tr[i].style.display = "none";
            }
        }
    }
}


































